use std::sync::{Arc, Mutex};
use crate::decimal::TPCHDecimal;
use rand::prelude::*;
use rand_distr::{Distribution, Normal};
use rand::rngs::SmallRng; // Use SmallRng instead of ThreadRng

#[derive(Debug, Clone)]
pub struct DistanceKDE {
    samples: Vec<f64>,
    bandwidth: f64,
    rng: Arc<Mutex<SmallRng>>,
}

impl DistanceKDE {
    pub fn new(samples: Vec<f64>, bandwidth: f64) -> Self {
        Self {
            samples,
            bandwidth,
            rng: Arc::new(Mutex::new(SmallRng::from_entropy())), // Initialize from entropy
        }
    }

    /// Generate a distance value using KDE
    pub fn generate(&mut self) -> f64 {
        // Choose a random sample as the base
        let mut rng_guard = self.rng.lock().unwrap();
        let sample_idx = rng_guard.gen_range(0..self.samples.len());
        let base = self.samples[sample_idx];

        // Apply Gaussian kernel perturbation
        let normal = Normal::new(0.0, self.bandwidth).unwrap();
        let perturbation = normal.sample(&mut *rng_guard);

        // Ensure distance is positive and realistic
        (base + perturbation).max(0.1)
    }

    /// Generate a distance value as a Decimal
    pub fn generate_tpch_decimal(&mut self) -> TPCHDecimal {
        let value = self.generate();
        TPCHDecimal((value * 100.0) as i64)
    }
}

